Provided herein are methods of analyzing a plant cultivar containing at least one terpene synthase gene or a paralog thereof, that include:
(a) obtaining a nucleic acid sample from the plant cultivar;
(b) contacting the nucleic acid sample with at least one polynucleotide primer pair under amplification conditions, thereby preparing a mixture, wherein the polynucleotide primer pair hybridizes to a unique subsequence of the terpene synthase gene or a paralog thereof, wherein the unique subsequence of the terpene synthase gene or a paralog thereof is different than the other subsequences of the terpene synthase gene or a paralog thereof and the unique subsequence of the terpene synthase gene or a paralog thereof is different than the subsequences of other terpene synthase genes and/or paralogs thereof;
(c) amplifying the mixture, thereby obtaining an amplified mixture; and
(d) analyzing the amplified mixture of (c), whereby at least one terpene synthase gene or a paralog thereof is identified and/or quantified in the amplified mixture.

In embodiments, provided herein is a method of preparing nucleic acid containing at least one terpene synthase gene or a paralog thereof from a plant cultivar comprising the at least one terpene synthase gene or a paralog thereof, that include:
(a) obtaining a nucleic acid sample from the plant cultivar;
(b) contacting the nucleic acid sample with at least one polynucleotide primer pair under amplification conditions, thereby preparing a mixture, wherein the polynucleotide primer pair hybridizes to a unique subsequence of the terpene synthase gene or a paralog thereof, wherein the unique subsequence of the terpene synthase gene or a paralog thereof is different than the other subsequences of the terpene synthase gene or a paralog thereof and the unique subsequence of the terpene synthase gene is different than the subsequences of the other terpene synthase genes and/or paralogs thereof;
(c) amplifying the mixture, thereby obtaining an amplified mixture; and
(d) analyzing the amplified mixture of (c), whereby at least one terpene synthase gene or a paralog thereof is identified and/or quantified in the amplified mixture.

Also provided herein is a method of analyzing a gene of a plant cultivar that belongs to a family of genes, wherein the gene comprises two or more exons, that includes:
(a) obtaining a nucleic acid sample from the plant cultivar;
(b) contacting the nucleic acid sample with at least one polynucleotide primer pair under amplification conditions, thereby preparing a mixture, wherein the polynucleotide primer pair hybridizes to a unique exon of the gene or a portion thereof, wherein the unique exon of the gene is different than the other exons of the gene and the unique exon of the gene is different than the exons of the other genes in the gene family;
(c) amplifying the mixture, thereby obtaining an amplified mixture; and
(d) analyzing the amplified mixture of (c), whereby the gene of the plant cultivar is identified and/or quantified in the amplified mixture.

Also provided herein is a method of analyzing a family of genes of a plant cultivar, wherein each gene of the family comprises two or more exons, that includes:
(a) obtaining a nucleic acid sample from the plant cultivar;
(b) contacting the nucleic acid sample with at least one polynucleotide primer pair under amplification conditions, thereby preparing a mixture, wherein the polynucleotide primer pair hybridizes to a unique exon of a gene or a portion thereof, wherein the unique exon of the gene is different than the other exons of the gene and the unique exon of the gene is different than the exons of the other genes in the family of genes;
(c) amplifying the mixture, thereby obtaining an amplified mixture; and
(d) analyzing the amplified mixture of (c), whereby at least one gene of the family of genes is identified and/or quantified in the amplified mixture.

