N1. A method of breeding one or more plant cultivars, comprising:
(i) obtaining one or more plant cultivars or samples therefrom;
(ii) preparing or analyzing nucleic acid from the one or more plant cultivars according to the method of any one of embodiments A1 to A50, Dl-D2 and Gl-G47;
(iii) based on (ii), identifying one or more plant cultivars as desirable for breeding or as not desirable for breeding; and
(iv) if one or more plant cultivars are identified as desirable for breeding in (iii), breeding all or a subset of the one or more plant cultivars so identified.

N1.1. A method of producing offspring from one or more plant cultivars, comprising:
(i) obtaining one or more plant cultivars or samples therefrom;
(ii) analyzing nucleic acid from the one or more plant cultivars according to the method of any one of embodiments A1 to A50, D1-D2 and G1-G47;
(iii) based on (ii), identifying one or more plant cultivars as desirable for breeding or as not desirable for breeding; and
(iv) if one or more plant cultivars are identified as desirable for breeding in (iii), breeding all or a subset of the one or more plant cultivars so identified, thereby producing offspring of the one or more plant cultivars so identified.

